SourceEntity.a:_sQL:
ALTER Function dbo.CalcBookCostBookValue
(
	@accountID BigInt, 
	@canvasID UniqueIdentifier = null, 
	@teamID UniqueIdentifier, 
	@lastUpdated DateTimeOffset = null,
    @InstrumentID UniqueIdentifier,
    @TransactionDate Date,
    @TransactionID UniqueIdentifier
)
RETURNS TABLE 
AS
RETURN 
(

select @TransactionDate as TransactionDate,
       @InstrumentID as InstrumentID, --0.0 as BookCost, 0.0 as BookValue
(select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code = 'PCC') 
- coalesce((select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code = 'PCS'),0.0) as BookCost, 
(select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code in ('PCC','PUPNL') ) 
- coalesce((select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code = 'PCS'),0.0) as BookValue,
coalesce((select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code = 'PCS'),0.0) as RealisedCost,
coalesce((select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code in ('PROC','INCEXP')),0.0) as GlobalProceeds,
coalesce((select sum(LocalAmount) from UnpivotTPres(@accountID ,@canvasId, @teamID,@lastUpdated,@InstrumentID,@TransactionDate,@TransactionID) where code = 'INCEXP'),0.0) as Income
)
